import React from "react";
import "./SearchBar.css";
import InputField from "./InputField";
import LargeButton from "./LargeButton";
function SearchBar()
{
    const imgStyle={
        src:"dc",
        alt:"search bar icon"
    }
    return(
        <div id="searchCont">
            <InputField 
                type="text"
                width="500px"
                fontSize="20px"
                placeholder="Search"
            />
            <LargeButton
                width="100px"
                height="100%"
                
            />
        </div>

    );
}

export default SearchBar;
